import React, { useState } from 'react';
import 'chart.js';
import 'chartjs-adapter-date-fns';
import { Line } from 'react-chartjs-2';
import { LinearScale, CategoryScale, PointElement, LineElement, Chart } from 'chart.js';
import './frisbee.module.css';

Chart.register(LinearScale, CategoryScale, PointElement, LineElement);

const getInitialScores = (holeCount) => {
  const scores = [];
  for (let i = 0; i < holeCount; i++) {
    scores.push(3); // Set the initial scores to par values (3)
  }
  return scores;
};

const App = () => {
  const [games, setGames] = useState([]); // State to store the list of games
  const [currentGame, setCurrentGame] = useState(null); // State to track the current game
  const [currentHole, setCurrentHole] = useState(0); // State to track the current hole

  const addGame = () => {
    const newGame = {
      id: games.length + 1,
      parData: [3, 3, 4, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3],
      userScores: getInitialScores(18),
    };
    setGames([...games, newGame]);
  };

  const handleScoreChange = (gameId, index, score) => {
    if (score < 1) {
      // If the score is lower than 1, display an error message or take appropriate action
      alert("Score cannot be lower than 1");
      return;
    }

    setGames((prevGames) => {
      const updatedGames = prevGames.map((game) => {
        if (game.id === gameId) {
          const updatedScores = [...game.userScores];
          updatedScores[index] = score;
          return { ...game, userScores: updatedScores };
        }
        return game;
      });
      return updatedGames;
    });
  };

  const handlePrevHole = () => {
    if (currentHole > 0) {
      setCurrentHole(currentHole - 1);
    }
  };

  const handleNextHole = () => {
    if (currentHole < 17) {
      setCurrentHole(currentHole + 1);
    }
  };

  const selectGame = (gameId) => {
    setCurrentGame(gameId);
    setCurrentHole(0);
  };

  return (
    <div>
      <h1>Ekeberg Frisbee Golf</h1>
      {games.map((game) => (
        <div key={game.id}>
          <h2>Game {game.id}</h2>
          <div>Total Par: {game.parData.reduce((acc, score) => acc + score, 0)}</div>
          <div>Total Score: {game.userScores.reduce((acc, score) => acc + score, 0)}</div>
          <Line
            data={{
              labels: game.parData.map((_, index) => `Hole ${index + 1}`),
              datasets: [
                {
                  label: 'Par',
                  data: game.parData,
                  borderColor: 'red',
                  borderWidth: 1,
                  fill: false,
                },
                {
                  label: 'User',
                  data: game.userScores,
                  borderColor: 'blue',
                  borderWidth: 1,
                  fill: false,
                },
              ],
            }}
            options={{
              scales: {
                y: {
                  type: 'linear',
                  beginAtZero: true,
                  title: {
                    display: true,
                    text: 'Scores',
                  },
                  ticks: {
                    stepSize: 1,
                  },
                },
                x: {
                  title: {
                    display: true,
                    text: 'Holes',
                  },
                },
              },
            }}
          />
          <div>
            <div>
              Current Hole: {currentHole + 1}
            </div>
            <div>
              Score: {game.userScores[currentHole]}
            </div>
            <button onClick={handlePrevHole} disabled={currentHole === 0}>Previous Hole</button>
            <button onClick={handleNextHole} disabled={currentHole === 17}>Next Hole</button>
          </div>
          <button onClick={() => selectGame(game.id)}>Select Game</button>
        </div>
      ))}
      {currentGame && (
        <div>
          <h3>Update Score</h3>
          <input
            type="number"
            value={games[currentGame - 1].userScores[currentHole]}
            onChange={(e) => handleScoreChange(currentGame, currentHole, parseInt(e.target.value))}
          />
        </div>
      )}
      <button onClick={addGame}>Add Game</button>
    </div>
  );
};

export default App;
